select c.c_id, c.c_fname, c.c_lname, r.rental_id, r.r_start_date, r.r_end_date, rd.rental_detail_id,  rd.v_id, v_price, v_type, v_reg, i.insurance_id, i.insurance_price, ip.in_type
from Customer c 
inner join Rentals r 
inner join Vehicle v 
inner join rental_details rd
inner join insurance i 
inner join insuranceType ip 
on c.c_id = r.c_id and rd.v_id = v.v_id and r.rental_id = rd.rent_id and i.insurance_id = r.insurance_id and ip.in_type_id = i.in_type_id and r.r_end_date like '%2006%' 
order by c_fname asc;

select b.b_address, b.b_phone, b.city_id, ci.city_name, ci.country_id, co.country_name, e.branch_id, e.e_fname, e.e_lname, et.job_type, c.emp_id, c.c_fname, c.c_lname, c.c_id, c_address
from branch b
inner join city ci
inner join country co 
inner join employee e
inner join customer c
inner join employee_type et
where b.b_id = e.branch_id and b.city_id = ci.city_id and ci.country_id = co.country_id and c.emp_id = e.employee_id and co.country_name like '%Ireland%' and e.job_type_id = et.job_type_id and et.job_type like '%Customer%'
order by b_address desc;

select c.country_id, c.country_name, c.vat_rate_id, v.vat_rate
from country c 
inner join vat_rate v
where c.vat_rate_id = v.vat_rate_id;

select rd.rent_id, v.v_id, datediff(r.r_start_date,r.r_end_date) as totalTime, sum(v_price*totalTime) as totalCost
from vehicle v 
inner join rental_details rd
inner join rentals r
where rd.rent_id = r.rental_id and v.v_id = rd.v_id;

select e.employee_id, e.e_fname, e.e_lname, c.c_id, c.c_fname, c.c_lname
from employee e
inner join customer c 
where e.employee_id = c.emp_id order by employee_id asc;

select count(c_id)
from customer;

select count(employee_id)
from employee;

select count(v_id)
from vehicle;

